Blu-ray source is MPEG2, heavily pictureboxed (http://imgbox.com/LBVfdciL)
and suffers from plenty of age.

The feature encodes are restored (duplicate frames removed) where necessary.
One exception, His Bitter Pill 1916, has 2 floating dupe fps remaining in a couple of scenes.

All 28 audio commentaries are included.
List of commentaries : &lt;a href=&quot;
http://www.silentcomedymafia.com/viewtopic.php?f=5&amp;t=1218&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.silentcomedymafia.com/viewtopic.php?f=5&amp;t=1218&lt;/a&gt;

Re. the extras :
'Outtakes..' is presented on the blu-ray with hard-encoded blends.
'A Drive..' has some random dupe pattern that fried my noggin.
Not much I could do, so they're encoded as they came.

